$templateCache.put("js/faq/cookFaq-nopay.html","<div class=\"fade-in\">\n    <div class=\"col-md-3\" ng-style=\"tabSelected == \'cooks\' && {\'padding-top\' : \'20px\'}\">\n        <ul class=\"nav nav-pills nav-stacked\">\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'general\'\" ng-class=\"{\'active\' : sectionSelected == \'general\'}\"><a href=\"#general\">General</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'profile\'\" ng-class=\"{\'active\' : sectionSelected == \'profile\'}\"><a href=\"#profile\">Profile</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'order\'\" ng-class=\"{\'active\' : sectionSelected == \'order\'}\"><a href=\"#order\">Order</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'booking\'\" ng-class=\"{\'active\' : sectionSelected == \'booking\'}\"><a href=\"#booking\">Booking</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'payment\'\" ng-class=\"{\'active\' : sectionSelected == \'payment\'}\"><a href=\"#payment\">Payment</a></li>\n            <li role=\"presentation\" ng-click=\"sectionSelected = \'settings\'\" ng-class=\"{\'active\' : sectionSelected == \'settings\'}\"><a href=\"#settings\">Settings</a></li>\n        </ul>\n    </div>\n\n    <div class=\"col-md-9\">\n        <div id=\"general\">\n\n            <h3 class=\"fa-border bg-info text-center\">General</h3>\n\n            <p><strong>What is SaltdKurry?</strong></p>\n            <p>We are an online community of cooks and bakers where you can order homemade food or book a personal cook on-demand.</p>\n\n            <p><strong>Why should I join SaltdKurry as a cook/baker?</strong></p>\n            <p>Start making money by cooking in a fun and flexible way. With SaltdKurry, you manage your online business by creating your profile and you decide when to cook/bake and which orders/bookings to accept.\n                More importantly, you be your own boss and earn money when you like.\n            </p>\n\n            <p><strong>What is SaltdKurry Code of Ethics?</strong></p>\n            <p>Our goal at SaltdKurry is to maintain the highest standards of conduct of each active member, expect each member to adhere to a code of ethics, promote healthy and safe kitchen practices, and enforce the rules laid out in the code of ethics.\n                The <a href=\"/code-of-ethics\">Code of Ethics</a> ensures the highest quality of service, cleanliness and safety associated with the service.\n            </p>\n\n        </div>\n        <div id=\"profile\">\n\n            <h3 class=\"fa-border bg-info text-center\">Profile</h3>\n\n            <p><strong>I\'m interested in registering as a personal cook. What are the steps involved?</strong></p>\n            <p>\n            Once you signup, navigate to your profile.\n            <div class=\"paragraph-style\">\n                <div>1. Establish your service area</div>\n                <div>2. Upload Profile Picture</div>\n                <div>3. Activate Personal Cook Profile</div>\n                <div>4. Setup Personal Cook profile</div>\n            </div>\n            </p>\n\n            <p><strong>I\'m a home based cook. How do I start my business?</strong></p>\n            <p>\n            Congratulations! We are here to help.\n                <div class=\"paragraph-style\">\n                    <div>1. Enter your address</div>\n                    <div>2. Upload Profile Picture</div>\n                    <div>3. Acivate Lunchbox Menu</div>\n                    <div>4. Setup your menu</div>\n                </div>\n            </p>\n\n            <p><strong>I\'m a baker. How do I get started?</strong></p>\n            <p>\n                That\'s wonderful. We are here to help.\n            <div class=\"paragraph-style\">\n                <div>1. Enter your address</div>\n                <div>2. Upload Profile Picture</div>\n                <div>3. Acivate Baker Menu</div>\n                <div>4. Setup your menu</div>\n            </div>\n            </p>\n\n            <p><strong>What is the importance of service area?</strong></p>\n            <p>\n                This is applicable for Personal cooks.\n                Service area is where you want to provide your cooking services.\n                It is important for Personal Cooks to define their service area in order to receive requests from within the service area.\n                Set your service area based on your feasibility to travel.\n            </p>\n\n            <p><strong>Why should I complete my cooking profile?</strong></p>\n            <p>It is important to save your completed profile to appear in the search results. Don\'t worry you can update your profile at anytime in the future.</p>\n\n            <p><strong>I don\'t see my cuisine/specialty in the list</strong></p>\n            <p>Please <a href=\"/contact\">contact us</a> and we will add your cuisine/specialty.</p>\n\n        </div>\n        <div id=\"order\">\n\n            <h3 class=\"fa-border bg-info text-center\">Order</h3>\n\n            <p><strong>What is Lunchbox?</strong></p>\n            <p>\n                At SaltdKurry, we want to empower personal cooks as well home based cooks and bakers by providing a platform to start their own business.\n                Lunchbox is where a Foodie orders food from home based cooks.\n            </p>\n\n            <p><strong>How can I receive orders?</strong></p>\n            <p>Navigate to your profile and activate Lunchbox Menu. Add your Lunchbox menu and complete your profile. Once your profile is approved, you should appear in the search results. If Foodies are interested in your menu, you should start receiving orders.</p>\n\n            <p><strong>How long does it take to update my profile changes?</strong></p>\n            <p>Please allow for 30 minutes for your changes to be reflected.</p>\n\n            <p><strong>How can I communicate with the Foodie?</strong></p>\n            <p>Once you receive an order, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Why is important to complete my order?</strong></p>\n            <p>Getting paid for your work is one of the final steps in the order process and can happen only when you complete your order.</p>\n\n            <p><strong>What if I choose to decline an order?</strong></p>\n            <p>We highly encourage all the cooks and bakers to maintain a 100% acceptance and completion rate. This is important to be considered for our Elite Club (coming soon).</p>\n\n        </div>\n        <div id=\"booking\">\n\n            <h3 class=\"fa-border bg-info text-center\">Booking</h3>\n\n            <p><strong>How can I receive bookings?</strong></p>\n            <p>Navigate to your profile and activate Personal Cook Profile. Complete your profile, and once its approved, you should appear in the search results. If Foodie\'s are interested in your profile, you should start receiving requests.</p>\n\n            <p><strong>I have saved my profile by activating Personal Cook Profile but haven\'t received any booking requests.</strong></p>\n            <p>Try the following suggestions\n                <div class=\"paragraph-style\">\n                    <div>- Try to broaden your service area within your travel feasibility.</div>\n                    <div>- Be as descriptive as possible.</div>\n                    <div>- Try selecting more cuisines and specialties that you can cook.</div>\n                    <div>- Upload your most recent profile picture.</div>\n                </div>\n            </p>\n\n            <p><strong>How long does it take to update my profile changes?</strong></p>\n            <p>Please allow for 30 minutes for your changes to be reflected.</p>\n\n            <p><strong>How can I communicate with the Foodie?</strong></p>\n            <p>Once you receive a booking request, you can communicate through our in-app messaging.</p>\n\n            <p><strong>Why is important to complete my request?</strong></p>\n            <p>Getting paid for your work is one of the final steps in the booking process and can happen only when you complete your booking and generate an invoice for your Foodie.</p>\n\n            <p><strong>What if I choose to decline a request?</strong></p>\n            <p>We highly encourage all the cooks and bakers to maintain a 100% acceptance and completion rate. This is important to be considered for our Elite Club (coming soon).</p>\n\n        </div>\n        <div id=\"payment\">\n\n            <h3 class=\"fa-border bg-info text-center\">Payment</h3>\n\n            <p><strong>How do I receive payments?</strong></p>\n            <p>We at SaltdKurry, do not involve in money transactions in your region at this time. Please make arrangements with the foodie for any payments.</p>\n\n        </div>\n        <div id=\"settings\">\n\n            <h3 class=\"fa-border bg-info text-center\">Settings</h3>\n\n            <p><strong>How do I receive notifications?</strong></p>\n            <p>\n                By default, you will receive email notifications. If you would like to receive push notifications to any device, simply follow the instructions below.\n                <div class=\"paragraph-style\">\n                    <div>1. Login to SaltdKurry on the intended device through your browser</div>\n                    <div>2. Navigate to Settings</div>\n                    <div>3. Subscribe to Push Notification</div>\n                </div>\n            </p>\n\n            <p><strong>How can I change my profile picture?</strong></p>\n            <p>Under settings, either click on change profile picture or drag and drop your image within the area.</p>\n\n            <p><strong>Why is it important to verify my identity?</strong></p>\n            <p>Identity Verification could be done through Google or Facebook so that we know who you are. If you have not signed up using Google or Facebook, you will be asked to do so to confirm your identity.</p>\n\n        </div>\n    </div>\n\n</div>");
